                    int byte1 = 0x000000FF & (int)buffer[index + 0];
                    int byte2 = 0x000000FF & (int)buffer[index + 1];
                    int byte3 = 0x000000FF & (int)buffer[index + 2];
                    int byte4 = 0x000000FF & (int)buffer[index + 3];
                    
